I tried 27 slices of pizza over 21 days and couldn’t be happier 🍕🥰 SAVE THIS POST for your next NYC trip or pizza outing plus check out my full NYC pizza guide - link in bio!

The newest additions to my guide include:
🍕 My new fave classic pepperoni slice from @upsidepizza (the 1st in the video)
🍕 The burrata and salami slices from Williamsburg fave @lindustriebk 
🍕 My new fave classic cheese slice plus the Hot Boi with pepperoni, jalapeños & @mikeshothoney from @scarrspizza 
🍕 All the seasonal deliciousness from Jersey City favorite @razzanj 

Other yummy pizzerias featured in this video (some of which are in my guide!):
@mamas_too 
@lucali_bk
@marinarapizzanyc 
@joespizzanyc 
@zazzyspizza 
@forninopizza 

What are your favorite pizzerias in NYC so I can try them next time? #IndulgentEatsNYC #IndulgentEatsPizza

Red prawn pasta and sunset views are just a couple reasons to love @isolahk at @hkifcmall! 🦐🍝🌇 I just landed back in HK today and will def be seeking all the good food and views once I’m out of my 1 week hotel quarantine (details on my story!)

Isola is definitely one of my fave spots in the mall after a few visits, thanks to artful and delicious seafood dishes and now drinks by my man Waqas 🥃 They also just renovated the rooftop garden at the mall to take in those views even more! 🌅

@hkifcmall is also offering rebates of up to 110% off your purchase on dining and shopping when you spend at participating restaurants and shops - visit their profile or a concierge at the mall for details #IndulgentEatsHK
